import React from 'react'
import './cta.css'

const CTA = () => {
  return (
    <div className='jpt__cta'>
      <div className='jpt__cta-content'>
        <p>Request Early Access to Get Started</p>
        <h3>Register today & start exploring the endless possiblities.</h3>
      </div>
    </div>
  )
}

export default CTA
